function onChange(control, oldValue, newValue, isLoading) {
   if (isLoading || newValue == '') {
      return;
   }
	var rowObj = [];
	rowObj.push({
		"input_name": 'Slice_Differentiator',
		"input_description": '',
		"input_type": 'string',
		"input_value": g_form.getValue('slice_differentiator')

	});
	rowObj.push({
		"input_name": 'Slice_Domain',
		"input_description": '',
		"input_type": 'string',
		"input_value": g_form.getValue('slice_domain')

	});
	rowObj.push({
		"input_name": 'Slice_Location',
		"input_description": '',
		"input_type": 'string',
		"input_value": g_form.getValue('slice_location')

	});
	rowObj.push({
		"input_name": 'Slice_Type(SST)',
		"input_description": '',
		"input_type": 'integer',
		"input_value": g_form.getValue('slice_type_sst')

	});
	rowObj.push({
		"input_name": 'param',
		"input_description": '',
		"input_type": 'string',
		"input_value": g_form.getValue('param')

	});
	rowObj.push({
		"input_name": 'Cluster_Name',
		"input_description": '',
		"input_type": 'string',
		"input_value": g_form.getValue('cluster_name')

	});
	g_form.setValue('inputs', JSON.stringify(rowObj));	

}
